import './App.css';
//** Import React Router */
import { BrowserRouter, Switch, Route } from "react-router-dom";
//** Import Pages */
import Home from './components/Pages/Home/Home';
import About from './components/Pages/About/About';

function App() {
	return (
        <BrowserRouter>
			<Switch>
				<Route exact path="/" component={Home} />
				<Route exact path="/about" component={About} />
				<Route exact path="/services" component={OurTeam} />
				<Route exact path="/pricing" component={ContactUs} />
				<Route exact path="/ourTeam" component={AdminLogin} />
				<Route path="*" component={NotFound} />
			</Switch>
		</BrowserRouter>
    );
}

export default App;
